def prepare_fpocket_features(protein_list, input_path, output_file_name, dic_label):
    # the features will be storaged in the output dictionary
    output_dictionary = {}
    for pdb in protein_list:
        # get the directory containing pocket files
        direction_pockets = f"{input_path}/{pdb}_cleaned_out/pockets/"
        # get the all pockets found by Fpocket
        pocket_files = glob.glob(direction_pockets + "*.pdb")

        # Report if no pockets
        if len(pocket_files) < 1:
            warnings.warn("no pocket detected in %s" % pdb)
            continue
        os.chdir(direction_pockets)
        # while extracting fpocket features, we will label the pockets as well.
        for pocket in pocket_files:
            mass_center_of_pocket=protein_uti.identify_centre_of_mass(mol_path=f"{pocket}")
            if dic_label == "coach":
                fp_x, fp_y, fp_z=coach_dictionary.get(pdb)
                point_2 = fp_x, fp_y, fp_z
            elif dic_label == "dude":
                fp_x, fp_y, fp_z = dude_dictionary.get(f"{pdb}_ligand")
                point_2 = fp_x, fp_y, fp_z
            elif dic_label == "mti":
                fp_x, fp_y, fp_z = mti_dictionary.get(f"{pdb.split('-')[0]}_ligand")
                point_2 = fp_x, fp_y, fp_z
            elif dic_label == "ads":
                fp_x, fp_y, fp_z = ads_dictionary.get(f"{pdb.split('-')[0]}_ligand")
                point_2 = fp_x, fp_y, fp_z
            elif dic_label == "casf":
                fp_x, fp_y, fp_z = casf_dictionary.get(f"{pdb}_ligand")
                point_2 = fp_x, fp_y, fp_z
            elif dic_label == "pdbbind":
                fp_x, fp_y, fp_z = bindingdb_dictionary.get(f"{pdb}")
                point_2 = fp_x, fp_y, fp_z
            distance_pocket_ligand = abs(math.sqrt(sum([(a - b) ** 2 for a, b in zip(mass_center_of_pocket, point_2)])))
            if distance_pocket_ligand < 8:
                label=1
            else:
                label=0

            pocket_number = extract_pocket_number(pocket)
            features_collections = f"{input_path}/{pdb}_cleaned_out/{pdb}_cleaned_info.txt"
            cur_feature = parse_pocket_values(features_collections)

            pocket_features = cur_feature.get(str(pocket_number))
            pocket_features.update({
                'label': label,
                'distance': distance_pocket_ligand,
                'mass_center_x': mass_center_of_pocket[0],
                'mass_center_y': mass_center_of_pocket[1],
                'mass_center_z': mass_center_of_pocket[2],
                'fpx_x': fp_x,
                'fpx_y': fp_y,
                'fpx_z': fp_z
            })
            print(pocket_features)
            output_dictionary[pdb, pocket_number] = pocket_features
    print(output_dictionary)
    #parent_directory = os.path.dirname(current_path)
    os.chdir(current_dir)
    with open(f'{output_file_name}.csv', 'w', newline='') as csvfile:
        fieldnames = ['protein_pocket', 'Score', 'Druggability Score', 'Number of Alpha Spheres', 'Total SASA', 'Polar SASA',
                      'Apolar SASA', 'Volume', 'Mean local hydrophobic density', 'Mean alpha sphere radius',
                      'Mean alp. sph. solvent access', 'Apolar alpha sphere proportion', 'Hydrophobicity score',
                      'Volume score', 'Polarity score', 'Charge score', 'Proportion of polar atoms',
                      'Alpha sphere density', 'Cent. of mass - Alpha Sphere max dist', 'Flexibility', "label", "distance",
                      "mass_center_x",
                      "mass_center_y", "mass_center_z", "fpx_x", "fpx_y", "fpx_z"]
        writer = csv.DictWriter(csvfile, fieldnames=fieldnames)

        writer.writeheader()
        for key, value in output_dictionary.items():
            pdb_key = f"{key[0]}_{key[1]}"
            row_data = {'protein_pocket': pdb_key, **value}
            writer.writerow(row_data)


